    [KeyCode.LOWER_TG]: {"code":"LOWER_TG","description":"Toggle Lower: Switch to Lower. Tap this key again to return to the current layer.","label":"❐ Lower"},
    [KeyCode.LOWER_TT]: {"code":"LOWER_TT","description":"Lower Tap-Toggle. If you hold the key down, Lower becomes active, and then deactivates when you let go. And if you tap it, Lower simply becomes active (toggles on).","label":"TT Lower"},
    [KeyCode.LOWER_OSL]: {"code":"LOWER_OSL","description":"One-shot Lower: Flips Lower on, but only for one keypress. Once you press a key in Lower, it is then deactivated. You can keep Lower active by holding the key down.","label":"Lower OSL"},
    [KeyCode.TO]: {"code":"TO","description":"Direct switch to a layer. Works for switching to lower layers as well.","label":"TO"},
